import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
    return (
        <div>
            <h2>Dashboard</h2>
            <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/detail">Detail</Link>
            </li>
            </ul>
        </nav>
        </div>
    );
};

export default Dashboard;
